import React, {FunctionComponent} from "react";
import PageDetailInfo from "../PageDetail/PageDetailInfo";
import TitleProject from "../PageDetail/TitleProject";
import ContactArea from "../PageDetail/ContactArea";
import AlbumImage from "../PageDetail/AlbumImage";
import BelongProject from "./BelongProject";
import Validator from "../../modules/validator";
import ProjectPrice from "./ProjectPrice";
import RelatedAdSellLeases from './RelatedAdSellLeases'

// Material - UI
import Grid from "@material-ui/core/Grid";

//Add Comment
import CommentArea from "../Comment/Comment";

interface ProjectMainProps {
  propertyOverview: {
    id: string,
    building_density: string,
    type: string,
    status: string,
    floor_number: number,
    living_room_number: number,
    bed_room_number: number,
    toilet_room_number: number,
    gara_number: number,
    project: string,
    material: string,
    length: string,
    width: string,
    price: string,
    area: any,
    year_built: string,
    address: {
      text: string,
      ward: string,
      district: string,
      city: string
    },
    size: any,
    description: string,
    map: {
      lng: string,
      lat: string
    },
    title: string,
    updated_at: string
    created_at: string
    view_count: number,
    position_content: string|null
    infrastructure_content: string|null
  },
  images: ImageProp[],
  contact: ContactProp,
  imageType: string,
  objectUrl: string,
  avatar: string,
  updateCompareData: (data: CompareDataProps) => void;
}
interface CompareDataProps {
  avatar: string,
  title: string|null,
  id: string,
  type: string
}
interface ContactProp {
  image: string
  name: string
  address: string
  mobile: string
  phone: string
  email: string
}
interface ImageProp {
  alt_text: string
  description: string
  title: string
  src: string
}

const AdSellLeasesMain: FunctionComponent<ProjectMainProps> = (props: ProjectMainProps) => {
  console.log("props", props.propertyOverview)
  return (
    <div className="container-big">
      <Grid container spacing={3}>
        <Grid item className="project-detail__left">
          <TitleProject
            propertyOverview={props.propertyOverview}
            objectUrl={props.objectUrl}
            avatar={props.avatar}
            type={'ad_sell_lease'}
            updateCompareData={(data: CompareDataProps) => props.updateCompareData(data)}
          />
          <ProjectPrice price={props.propertyOverview.price} contact={props.contact}/>
          {/* <PageDetailInfo propertyOverview={props.propertyOverview} contact={props.contact}/> */}
          <AlbumImage images={props.images} imageType={props.imageType}/>
          {
            props.propertyOverview.project && !Validator.isBlank(props.propertyOverview.project) &&
            <BelongProject project={props.propertyOverview.project}/>
          }
          <CommentArea />
          <RelatedAdSellLeases address={props.propertyOverview.address} />
        </Grid>
        <Grid item className="project-detail__right">
          <div className="contact-area">
            <ContactArea contact={props.contact}/>
          </div>
        </Grid>
      </Grid>
    </div>
  );
};

export default AdSellLeasesMain;
